def reconstruct_ascii_art():
    print("Reconstructing analyzed image data using loops...")
    
    # LOOP 1: Go through each row in the analyzed data
    for row_data in analyzed_data:
        
        line_string = ""
        
        # LOOP 2: Go through each (count, symbol) group in the row
        for data_group in row_data:
            
            # Extract the count and the symbol from the tuple
            count = data_group[0]
            symbol = data_group[1]
            
            # LOOP 3: Add the symbol 'count' times to the string
            for i in range(count):
                
                # CONDITION: Only add if count is valid (simple check)
                if count > 0:
                    line_string = line_string + symbol
                    
        # Print the fully rebuilt line
        print(line_string)

# Run the function
reconstruct_ascii_art()
